  \"2016-03-21T20:36:04.691307\",\n\t\"name\": \"predator-gut-isotopes-characterizing-ecosystem-role-of-sharks\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This work uses white muscle tissues collected
  from sixgill and sevengill sharks to characterize the diet of each species. Tissues
  from prey species have also been prepared in order to initialize the models. We
  used mixing models to determine the probabilities of each prey species being in
  the diet of these top predators. These data will be used to predict which prey groups
  are impacted by these species, and then used in conjunction with patterns of daily,
  seasonal, and annual movement patterns to examine the variation in predatory impact
  across space and time among the various prey groups.nnIsotopes.\",\n\t\"license_title\":
